import styled from 'styled-components';

const ResidentInfo = styled.div`
  display: flex;
  flex: 100%;
  height: 50%;
  flex-direction: column;
  justify-content: space-around;
  align-items: flex-start;
  width: 100%;
  margin: 5px;
  align-self: center;
`;

export { ResidentInfo };
